function collapse(t){let e=document.querySelector(this.dataset.target),n=countChildren(e);e.classList.contains("collapsed")?setButtonText(this.children[0],"âˆ’"):setButtonText(this.children[0],`[${n}]`),e.classList.toggle("collapsed")}function countChildren(t){return t.childElementCount}function setButtonText(t,e){t.innerText=e}Array.from(document.getElementsByClassName("btn-collapse")).forEach(function(t){t.onclick=collapse});